import React from "react";
import { SpinnerContainer, SpinnerOverlay } from "./spinner-styles.js";

const Spinner = WrappedComponent => ({ isLoading, ...otherProps }) => {
	return isLoading ? (
		<SpinnerOverlay>
			<SpinnerContainer />
		</SpinnerOverlay>
	) : (
		<WrappedComponent {...otherProps} />
	);
};

export default Spinner;
